import React from "react"

export default function RecipeCard (props) {
    const {label, image, calories} = props.recipe
    Math.round(calories, 0)
    return(
        <li className="recipe-card">
            <h2>{label}</h2>
            <p>Calories: {calories}</p>
            <img src={image} alt=""/>
        </li>
    )
}
